import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class BagService {
  private bagCount = 0;

  addTobag(updateHeaderFunction: () => void) {
    this.bagCount++;
    updateHeaderFunction(); // Call the passed function
  }

  getBagCount(): number {
    return this.bagCount;
  }
}
